webpackJsonp([6343123863031],{7826:function(e,t){e.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2007/03/q35-red.gif" alt="Q35 red" /></p>\n<p>We\'re looking at a new notebook for MamaMaus. Since I don\'t think I can talk her into an Apple ("I don\'t want to learn anything new!"), I asked her what features she needed. "It needs to be small," she said, "and powerful." That wasn\'t a big help.</p>\n<p>Then she added, "I saw a red notebook from Samsung that looked pretty good." Well, if color is a main criterion, at least that limits the field somewhat. And the <a href="http://www.samsung.com/uk/products/mobilecomputing/qseries/np_q35t007suk.asp">Samsung Q35 Red</a> actually seems pretty good.</p>',fields:{title:"Samsung Q35 Red",date:"19 Mar 2007",url:"https://papascott.de/2007-03-19-samsung-q35-red/"}}},pathContext:{slug:"/2007-03-19-samsung-q35-red/",prev:{fields:{title:"Internet Operator",date:"19 Mar 2007",slug:"/2007-03-19-internet-operator/"}},next:{fields:{title:"",date:"20 Mar 2007",slug:"/2007-03-20-mcdonalds-seeks-to-redefine-mcjob/"}}}}}});
